  state = {
    opacity: 0,
    buttonClassName: 'about-me-button',
    innerHTMLP: 'About me',
  }

  componentDidMount() {
    this.handleTimer()
  }

  handleTimer = () => {
    setTimeout(() => {
      this.setState({
        opacity: 1
      })
    }, 1600)
  }

    render () {
